import React from "react";
// import { Link } from "react-router-dom";

const MovieDetails = ({ movie }) => {
  console.log(movie);
  if (!movie) return <p>Loading data...</p>;

  return (
    <>
      <h1>{movie.title}</h1>
    </>
  );
};

export default MovieDetails;
